INSERT INTO `suggestions` (`id_sug`, `user_id`, `suggestion`, `date_suggestion`, `reponse`, `date_reponse`, `fichier`, `created_at`, `updated_at`) VALUES
(1, 4, 'Bonjour M. AKICHI,\r\nCi-dessous une proposition a intégré à votre retour de vos congés.\r\n\r\n•	Pour les tâches affiliées aux différents corps de métiers nous ne pouvons pas les considérer comme des Projets :\r\nExample : support it ne doit pas être un projet car il n’a pas de date de fin, nous faisons le support tout le temps,\r\nPour pallier ce problème, Mme KAMAN propose pour chaque pole qu’il ait des catégories comme support IT,\r\nEt à chaque catégorie qu’il ait la possibilité d’ajouter des tâches indépendantes qui apparaitront dans la feuille de temps des collaborateur associés.\r\n\r\n•	Pour chaque projet faire sortir le tableau de synthèse des coûts et des charges \r\n\r\nCordialement.', '2022-03-04', NULL, NULL, NULL, '2022-03-04 10:12:36', '2022-03-04 10:12:36'),
(2, 4, 'dans la creation d\'un user mettre la civilité obligatoire', '2022-03-10', NULL, NULL, NULL, '2022-03-10 13:59:42', '2022-03-10 13:59:42');
